            (context.device.locale == "de_DE"  && context.viewedLocation.country == "GM"));
}

function hasBreakingNews() {
    return context.weatherSummary.contentMode !== null &&
        context.weatherSummary.contentMode.mode === "severe1" ||
        context.weatherSummary.contentMode.mode === "severe2";
}

function isInSegment(segment) {
    return context.profile !== undefined && 
        context.profile.settings !== undefined && 
        context.profile.settings.segmentation !== undefined && 
        context.profile.settings.segmentation["avr-a"] !== undefined &&
        context.profile.settings.segmentation["avr-a"].indexOf(segment) !== -1;
}

isValidLocaleAndViewingCountry() &&
isInSegment("v");

